import React, { useEffect } from 'react'
import { connect } from 'react-redux'
import { fetchingData } from '../redux/ReducerComponents/User/Action'


function Main({ userData, fetchingData }) {

    useEffect(() => {
        fetchingData()
    }, [])

    return (
        <div>
            <h1>Welcome to Redux</h1>
            {
                userData?.loading == true ? <h1>Loading...</h1> : userData?.error ? userData?.error : userData?.users?.map((user) => {
                    return (
                        <h1>{user?.name}</h1>
                    )
                })
            }
        </div>
    )
}


const mapStateToProps = state => {
    console.log(state.user)
    return {
        userData: state?.user
    }
}

const mapDispatchToProps = dispatch => {
    return {
        fetchingData: () => dispatch(fetchingData())
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(Main)
